const i=[{id:1,title:"小兔子乖乖",audioUrl:"https://img.happywisdom.org/小兔子乖乖.mp3",image:"/images/nursery-rhyme/小兔子乖乖.jpg",content:"小兔子乖乖，把门开开，快点开开，我要进来。"},{id:1,title:"两只老虎",audioUrl:"https://img.happywisdom.org/两只老虎.mp3",image:"/images/nursery-rhyme/两只老虎.jpg",content:"两只老虎，两只老虎，跑得快，跑得快，一只没有耳朵，一只没有尾巴，真奇怪，真奇怪。"},{id:2,title:"小星星",audioUrl:"https://img.happywisdom.org/小星星.mp3",image:"/images/nursery-rhyme/小星星.jpg",content:"一闪一闪亮晶晶，满天都是小星星，挂在天上放光明，好像许多小眼睛。"},{id:3,title:"拔萝卜",audioUrl:"https://img.happywisdom.org/拔萝卜.mp3",image:"/images/nursery-rhyme/拔萝卜.jpg",content:"拔萝卜，拔萝卜，嘿呦嘿呦拔萝卜，拔不动，拔不动，老公公快来帮个忙。"},{id:4,title:"世上只有妈妈好",audioUrl:"https://img.happywisdom.org/世上只有妈妈好.mp3",image:"/images/nursery-rhyme/世上只有妈妈好.jpg",content:"世上只有妈妈好，有妈的孩子像块宝，投进妈妈的怀抱，幸福享不了。"},{id:5,title:"小兔子乖乖",audioUrl:"https://img.happywisdom.org/小兔子乖乖.mp3",image:"/images/nursery-rhyme/小兔子乖乖.jpg",content:"小兔子乖乖，把门开开，快点开开，我要进来。"},{id:6,title:"虫儿飞",audioUrl:"https://img.happywisdom.org/虫儿飞.mp3",image:"/images/nursery-rhyme/虫儿飞.jpg",content:"黑黑的天空低垂，亮亮的繁星相随，虫儿飞，虫儿飞，你在思念谁？"},{id:7,title:"找朋友",audioUrl:"https://img.happywisdom.org/找朋友.mp3",image:"/images/nursery-rhyme/找朋友.jpg",content:"找呀找呀找朋友，找到一个好朋友，敬个礼呀握握手，你是我的好朋友。"},{id:8,title:"蜗牛与黄鹂鸟",audioUrl:"https://img.happywisdom.org/蜗牛与黄鹂鸟.mp3",image:"/images/nursery-rhyme/蜗牛与黄鹂鸟.jpg",content:"阿门阿前一棵葡萄树，阿嫩阿嫩绿地刚发芽，蜗牛背着那重重的壳呀，一步一步地往上爬。"},{id:9,title:"一分钱",audioUrl:"https://img.happywisdom.org/一分钱.mp3",image:"/images/nursery-rhyme/一分钱.jpg",content:"我在马路边，捡到一分钱，把它交到警察叔叔手里面。"},{id:10,title:"摇篮曲",audioUrl:"https://img.happywisdom.org/摇篮曲.mp3",image:"/images/nursery-rhyme/摇篮曲.jpg",content:"摇啊摇，摇到外婆桥，外婆叫我好宝宝，吃饭饭，睡觉觉。"},{id:11,title:"泥娃娃",audioUrl:"https://img.happywisdom.org/泥娃娃.mp3",image:"/images/nursery-rhyme/泥娃娃.jpg",content:"泥娃娃，泥娃娃，一个泥娃娃，坐在大门口，看家又看花。"},{id:12,title:"春天在哪里",audioUrl:"https://img.happywisdom.org/春天在哪里.mp3",image:"/images/nursery-rhyme/春天在哪里.jpg",content:"春天在哪里呀，春天在哪里，春天在那青翠的山林里。"},{id:13,title:"妈妈的吻",audioUrl:"https://img.happywisdom.org/妈妈的吻.mp3",image:"/images/nursery-rhyme/妈妈的吻.jpg",content:"小时候，妈妈对我讲，大海就是我故乡，海边出生，海里成长。"},{id:14,title:"让我们荡起双桨",audioUrl:"https://img.happywisdom.org/让我们荡起双桨.mp3",image:"/images/nursery-rhyme/让我们荡起双桨.jpg",content:"让我们荡起双桨，小船儿推开波浪，海面倒映着美丽的白塔，四周环绕着绿树红墙。"},{id:15,title:"快乐的节日",audioUrl:"https://img.happywisdom.org/快乐的节日.mp3",image:"/images/nursery-rhyme/快乐的节日.jpg",content:"小鸟在前面带路，风儿吹向我们，我们像春天一样，充满了欢乐的歌声。"},{id:16,title:"小螺号",audioUrl:"https://img.happywisdom.org/小螺号.mp3",image:"/images/nursery-rhyme/小螺号.jpg",content:"小螺号嘀嘀嘀吹，海鸥听了展翅飞，小螺号嘀嘀嘀吹，浪花听了笑微微。"},{id:17,title:"爸爸妈妈听我说",audioUrl:"https://img.happywisdom.org/爸爸妈妈听我说.mp3",image:"/images/nursery-rhyme/爸爸妈妈听我说.jpg",content:"爸爸妈妈听我说，我爱你们不会变，长大一定报答你，幸福天天伴你们。"},{id:18,title:"兰花草",audioUrl:"https://img.happywisdom.org/兰花草.mp3",image:"/images/nursery-rhyme/兰花草.jpg",content:"我从山中来，带着兰花草，种在小园中，希望花开早。"},{id:19,title:"白龙马",audioUrl:"https://img.happywisdom.org/白龙马.mp3",image:"/images/nursery-rhyme/白龙马.jpg",content:"白龙马，蹄儿朝西，驮着唐三藏跟着仨徒弟。"},{id:20,title:"我们是共产主义接班人",audioUrl:"https://img.happywisdom.org/我们是共产主义接班人.mp3",image:"/images/nursery-rhyme/我们是共产主义接班人.jpg",content:"我们是共产主义接班人，继承革命先辈的光荣传统，爱祖国，爱人民。"}];export{i as default};
